import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the featured products grid by ID (different selector)
    await page.waitForSelector('#productsGrid', { timeout: 5000 });

    // Find the first product card using a CSS selector for the product title text (different strategy)
    const productCard = await page.locator('.product-card:has-text("iPhone 15 Pro Max")').first();
    await productCard.waitFor({ state: 'visible', timeout: 5000 });

    // Take screenshot before opening modal
    const beforeModalShot = path.join(screenshotsDir, 'step_2_before_modal.png');
    await page.screenshot({ path: beforeModalShot });
    screenshots.push(beforeModalShot);

    // Click the product card to open the product detail modal
    await productCard.click();

    // Wait for the modal to appear using a different selector strategy (ID and class)
    await page.waitForSelector('#productModal', { timeout: 5000 });
    await page.waitForSelector('#productModal[style*="display: block"]', { timeout: 5000 });

    // Wait for the product detail content inside the modal
    await page.waitForSelector('#productDetail .product-detail-title', { timeout: 5000 });

    // Take screenshot of the open modal
    const modalOpenShot = path.join(screenshotsDir, 'step_3_modal_open.png');
    await page.screenshot({ path: modalOpenShot });
    screenshots.push(modalOpenShot);

    // Extract product title from the modal for verification
    const modalTitle = await page.locator('#productDetail .product-detail-title').innerText();

    return {
      success: true,
      action: "Opened the Product Detail Modal for 'Apple iPhone 15 Pro Max'",
      extractedData: {
        modalTitle: modalTitle.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
